import React from 'react';
import { useTranslation } from 'react-i18next';

function Header() {
  const { i18n } = useTranslation();

  const changeLanguage = (lng) => {
    i18n.changeLanguage(lng);
  };

  return (
    <nav className="navbar navbar-expand-lg bg-dark" data-bs-theme="dark">
      <div className="container">
        <a className="navbar-brand" href="/">Главная</a>
        <div className="dropdown">
          <button className="btn btn-outline-light dropdown-toggle" type="button" id="languageDropdown" data-bs-toggle="dropdown" aria-expanded="false">
            Язык
          </button>
          <ul className="dropdown-menu dropdown-menu-end" aria-labelledby="languageDropdown">
            <li>
              <button className="dropdown-item" onClick={() => changeLanguage('ru')}>Русский</button>
            </li>
            <li>
              <button className="dropdown-item" onClick={() => changeLanguage('en')}>English</button>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default Header;
